  \"2016-07-27T22:51:27.383437\",\n\t\"name\": \"talcot-lake-national-wildlife-refuge-narrative-report-september-october-november-and-decem\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Talcot Lake NWR
  outlines Refuge accomplishments from September through December of 1946. The report
  begins by summarizing the weather conditions and water conditions during this period.
  Wildlife- including migratory birds, upland game birds, furbearers, predators, rodents,
  raptors, and fish- is also covered. The Refuge development and maintenance section
  discusses physical developments. Resource management is outlined; topics include
  grazing and fur harvesting. The public relations section of the report describes
  recreational uses, Refuge visitors, Refuge participation, and hunting. N-R forms
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
